  [],\n\t\"revision_timestamp\": \"2016-07-27T22:22:43.793000\",\n\t\"name\": \"quivira-national-wildlife-refuge-annual-narrative-report-calendar-year-1994\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Quivira
  NWR summarizes Refuge activities during the 1994 calendar year.  The report begins
  with a summary of the yearu2019s highlights and climatic conditions.   The report
  includes a planning section which discusses research and investigations.  Refuge
  administration is outlined; information about personnel, youth programs, volunteers,
  funding, safety, and technical assistance is given.  Habitat management is also
  covered.  Subjects include wetlands, croplands, grasslands, grazing, fire, and pest
  control.  The wildlife section of the report discusses wildlife diversity, threatened
  and endangered species, waterfowl, marsh and water birds, shorebirds, gulls, terns
  and allied species, raptors, other migratory birds, game animals, other resident
  wildlife, and animal control.  The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, hunting, fishing, wildlife observation
  and law enforcement.  The equipment and facilities section of the report provides
  information about new construction, rehabilitation, maintenance and equipment.  Items
  of interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
